def normalize_tickers(raw: str) -> List[str]:
    tickers: List[str] = []
    for part in raw.split(","):
        ticker = part.strip().upper()
        if not ticker:
            continue
        if "." not in ticker and not ticker.startswith("^"):
            ticker = f"{ticker}.SA"
        tickers.append(ticker)
    return tickers

